import "./CardStyle.css"

const Card = (props) => {
  const {name, image, id, plataforms, genero} = props;

  return (
    <>
      <div className="container" key={id}>
        <main className="wrapper">
          <img className="banner-image" width="200px" height="170px" src={image} alt={name} />
          <h1>{name}</h1>
          {
            plataforms?.map((elem, index) => {
              return (
                <p key={index}>{elem}</p>
              )
            })
          }
          {
            genero?.map((genre, index) => {
              return (
                <h4 key={index}>{genre}</h4>
              )
            })
          }
        </main>
        <footer className="button-wrapper">
          <button className="btn outline">DETAILS</button>
          <button className="btn fill">DELETE</button>
        </footer>
      </div>
    </>
  );
};

export default Card;
